INSERT INTO `Entries` VALUES ('032a20b6-aa96-4fd5-8c98-ba1b68031792','Stairs Up the Mountain','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 11:29:48','Ancient, ruined, and ramshackle stairs built into the side of a small mountain. Magical candles illuminate the way.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'Ancient Magic, Portals, Candles, Magus Statue','2024-05-27 11:32:10','2024-05-29 22:00:39'),('0529e1de-2a9c-4b39-80a5-4416a6d406ba','Witches Druids Brew','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 07:26:57','Witches and Druids can often brew potions that can be used to purify corruption and other useful functions. The Witch or Druid are likely to ask you to gather ingredients for them so that either they or you can craft the brew.  ','','','','','',NULL,NULL,'123','2024-05-27 07:29:02','2024-05-27 07:29:02'),('06144eae-1b6d-4838-8f17-8376e4deca61','River Tilarium','6ae3d6dd-c907-4019-989a-f921cf94b4ed','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 11:39:57','This is the River Tilarium, and it flows from the mountain tops where windmills are perched down to the ocean. It is used mostly as a fresh water source but also for transport of certain goods as they get floated down the river.  ','','f82f7be6-d348-46a8-8dcc-47513100d121','','','',NULL,NULL,'123','2024-05-27 11:41:57','2024-05-27 11:41:57'),('079884b5-565a-4f80-874a-75fa0c73aed3','Source','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 04:20:20','The Source are tall, slender humanoids with tentacles and minimal armour. They wield significant magical and psionic power. Fleeing is the best strategy against them unless you are a veteran adventurer. ','','','','','',NULL,NULL,'123','2024-05-27 04:23:36','2024-05-27 04:23:36'),('07b69216-60d0-4764-a225-27ac22797a2f','Hunters Camp','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 06:26:12','A small camp, recently abandoned by local hunters. Their cooking fire is still burning, and a scared and somewhat questionable looking rabbit remains in a cage.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:28:54','2024-05-27 06:28:54'),('0c7fe9ba-3371-4cb6-ae64-6a8b3146ce9d','Skeletons','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 06:21:36','Skeletons are animated creatures, usually deceased humans animated by a necromancer. ','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','','',NULL,NULL,'123','2024-05-27 06:24:41','2024-05-27 06:24:41'),('115d4bc1-ae76-4000-a8e1-e40a72c58821','Hidden Druid Grove','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 08:27:37','A small, makeshift Druid grove/shrine. It has been hastily constructed after certain events led to the Sacred Grove further inland had to be abandoned.   ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 08:32:05','2024-05-27 08:32:05'),('15ab2adc-62b0-43e6-aa09-a72dfebd7387','Arcane Magic','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 04:31:00','Arcane Magic is magic derived from analysing, experimenting, understanding and mastering the rules of the universe themselves. Unlike Divine Magic, Arcane Magic is not given by the gods  is it learnt and understood by the user themselves, often after having been trained by a master. Arcane Magic users, often called Mages, Wizards or Sorcerers, are usually not very popular and are highly self-motivated.','','','','','',NULL,NULL,'123','2024-05-27 04:33:40','2024-05-27 04:33:40'),('15b1c472-c6bb-41ab-97a5-c48f0f8e3107','Flooded Bridge','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-28 04:49:58','Recent heavy rains and a lack of upkeep have left these bridges worse for wear.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:52:01','2024-05-28 04:52:01'),('1846c45f-77cd-423f-9f0b-c0c596b3af60','Sacred Druid Grove','6ae3d6dd-c907-4019-989a-f921cf94b4ed','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 10:03:21','In a bid of heal the land of the foul Corruption that had scoured it, the local Druid, Armanias, managed to collect a large amount of Corruption in a sacred crystal, and cast a cleansing ritual to create a bunch of crystal shards that aid in purifying the land of the evil.  ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','','',NULL,NULL,'123','2024-05-27 10:07:10','2024-05-27 10:07:10'),('196c1db9-5e53-44ef-9e32-5c9a14494c5f','Rabbit','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 10:55:54','This rabbit has smelled strange un-natural smells while travelling the area, the smells are bad at the beehives and the farm where the big animals are. The rabbit tells you that some bad wolves smell strange too. ','','f82f7be6-d348-46a8-8dcc-47513100d121','','','',NULL,NULL,'123','2024-05-27 10:57:35','2024-05-27 10:57:35'),('1cfbdd06-add5-42b0-8e06-5d42730512ec','The Golem technical manual','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 05:52:36','The golem technical manual is an item that can sometimes be found in a locked chest, which can only be opened with the mine key. The manuals contain information about the golem. Only take one manual. The golem manual can be found in the strange machine room, in a locked metal chest.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','31c26934-30e1-46b4-9b95-53bee6b1d84b','','-12680.0,5140.0,840.0',NULL,NULL,'123','2024-05-27 05:55:55','2024-05-27 05:55:55'),('1d08aebf-2974-49bc-8fe1-e1a382097269','What Remains of the Horsecut family','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','9270deaf-7271-4cf6-852e-30d4a067d298','','2024-05-27 10:08:37','The twisted remains of the Horsecut family, locked in statuesque poses of agony, long since overtaken by The Corruption. Their bodies have become food for the strange growths that spawn when The Corruption takes hold. ','','9270deaf-7271-4cf6-852e-30d4a067d298','526d9422-4fc4-4112-b3d9-3e227a980afa','6ae3d6dd-c907-4019-989a-f921cf94b4ed','',NULL,NULL,'123','2024-05-27 10:11:36','2024-05-27 10:11:36'),('1f97d528-d319-4884-871b-3fa4356a8b9f','Sacred Druid Grove','6ae3d6dd-c907-4019-989a-f921cf94b4ed','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-28 04:04:59','The Grove is also home to an enormous Dragon Skeleton. Dragons are rare, ancient guardians of nature. They can live for 1000s of years, are highly elemental and extremely dangerous. ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:08:17','2024-05-28 04:08:17'),('209f3b89-8a73-493c-9881-6fd33e27ecda','Wind Mills','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 06:04:46','Remnants of Pre Dragon War Life that have somehow stood the test of time. These giant windmills harness the constant winds of Yellow Bay.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:07:32','2024-05-27 06:07:32'),('2542ebc4-926e-4a1c-a35c-9b3e4e05b654','Ethaevia basic lore','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 07:13:07','Two human nations and one Minotaur nation make up the countries along this coast of Ethaevia. However, Elves and seen in these parts, as are some Dwarves, as their mines exist below ground. ','','','','','',NULL,NULL,'123','2024-05-27 07:15:10','2024-05-27 07:15:10'),('25d2ec8f-2453-4d1c-9758-f43f1180dce8','The Corruption A','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-28 03:37:43','The corruption is a manifestation of dark magics that seems to possess a rudimentary malign intelligence which seems to be intent on corrupting all life in the world.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 03:40:34','2024-05-28 03:40:34'),('25f68966-e1f8-445b-89c4-2bb63d8f1e5b','Barricade','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','','2024-05-28 04:33:10','Residents of the small hamlet of Appleway thought it a good idea to install at least rudimentary defenses against the small horde of reanimated dead that have taken up residence between their home and the shore front. ','','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:34:36','2024-05-28 04:34:36'),('26adfce1-d0d6-45ce-9f8f-dc996c16cdd4','Standing Stones','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 07:23:52','Scattered around the Grove are moss covered standing stones.  Engraved on each are a series of markings.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 07:26:17','2024-05-27 07:26:17'),('27019f93-88fb-48f8-ae35-bf946f14ea72','Dragon Skeletons','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 03:23:58','The Massive remains of long dead dragons. Whether or not this the site of some ancient graveyard or that great battle is unknown. ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 03:36:08','2024-05-27 03:36:08'),('2744ffa4-55fb-4267-bc96-78dc5b5afe35','Strange Mineral','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 08:59:38','The strange mineral is located in the mines, near an ancient and strange looking switch, it grows out of some green rock and has an appearance like a green crystal cube. The area of the floor is near the strange machine room. ','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','31c26934-30e1-46b4-9b95-53bee6b1d84b','','6160.0,10680.0,830.0',NULL,NULL,'123','2024-05-27 09:02:28','2024-05-27 09:04:19'),('27b0d40b-5711-474d-a410-03a167424e69','The Beach','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 11:36:20','The beach is home to Garius, often simply called The Beachcomber, who voluntarily lives on the beach in a small shack on the northern end. He hunts fish and crabs and collects all the useful refuse on the beach and is often the first greeter visitors will see when arriving at Yellowbay. He knows everything about Yellowbay and is very generous with his time, knowledge and trinkets he has collected.  ','','1d79d99b-619d-4a28-bfa6-99873927fb03','','','',NULL,NULL,'123','2024-05-27 11:38:41','2024-05-27 11:38:41'),('2af16ee7-af8b-4c2c-b32f-fff670a691c5','Corrupted Horsecut Farm','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 03:53:33','Consumed by Corruption (Life-draining, evil corrupting force spread by the Scourge) ','','9270deaf-7271-4cf6-852e-30d4a067d298','','','',NULL,NULL,'123','2024-05-27 03:57:34','2024-05-27 03:57:34'),('2c9713a6-4dd3-436d-8a8f-64a60e26d74e','Abandoned Orchard Owners Cottage','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','232dd939-f596-448d-9e95-3b6a3b97751c','','2024-05-27 08:36:43','A recently abandoned cottage belonging to the owner of the Yellow bay Orchard. They left to seek the safety of  Appleway Hamlet after The Corruption began to take hold in the area.','','232dd939-f596-448d-9e95-3b6a3b97751c','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 08:39:00','2024-05-27 08:39:00'),('2e9a0d0a-acc4-45ae-b56d-24b51ec7d81d','Golems can be controlled and commanded. If a user has a specific magical bracelet or enough magical power to overwhelm a golem, they will do whatever the user requests.\n','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 09:09:23','Golems can be controlled and commanded. If a user has a specific magical bracelet or enough magical power to overwhelm a golem, they will do whatever the user requests.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','','',NULL,NULL,'123','2024-05-27 09:11:32','2024-05-27 09:11:32'),('2f2ece24-3252-46df-888a-7d89f896abcd','Strange Machine A','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 06:17:42','This strange machine appears to be both ceremonial and industrial in purpose.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','31c26934-30e1-46b4-9b95-53bee6b1d84b','','',NULL,NULL,'123','2024-05-27 06:20:39','2024-05-27 06:20:39'),('31dbdb35-f0c3-42e6-af21-8cd367967a89','Magic Attracted Flowers','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 07:20:11','Small clusters of white and lilac flowers seem to grow wherever certain magics have been used frequently.  ','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 07:22:57','2024-05-27 07:22:57'),('352a7208-5df1-4130-8894-950452c96b21','Yellow Trees','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-28 04:01:46','Some say that the vegetation found in Yellow Bay gets its distinct coloration from the residual magics that have leeched into the ground after centuries of mining and other magic based industries that have taken place in the area.  ','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:04:06','2024-05-28 04:04:06'),('3540b8c9-6a42-4062-8dc2-d41125096cbc','The Orchard','6ae3d6dd-c907-4019-989a-f921cf94b4ed','232dd939-f596-448d-9e95-3b6a3b97751c','','2024-05-28 03:45:54','The apples can be eaten for a small boost in HP. ','','','','','',NULL,NULL,'123','2024-05-28 03:47:52','2024-05-28 03:47:52'),('3795edaa-a38b-468d-8345-0d79a50a72a6','Giants','dae93ddb-a322-48b1-9976-ab9334b35444','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 04:56:07','Giants are enormous humanoids that roam the lands. While often they can be avoided with stealth and discretion, combat with them can be lethal. Apart from their ability to cause horrendous injury with their clubs (or any thing else they wield), their biggest risk is their ability to throw boulders. They can do this from very long range and a single hit is enough to kill most people.  ','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 05:02:58','2024-05-27 05:02:58'),('385a725e-ad61-4c22-aaed-7bdb8d5d692d','Abandoned Water Mill','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 05:08:47','Remnants of pre Dragon War life. These watermills have survived the years ','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 05:11:43','2024-05-27 05:11:43'),('399c2252-e53a-4a95-b418-596ceffa4810','Bee Hives A','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','232dd939-f596-448d-9e95-3b6a3b97751c','','2024-05-28 03:57:57','Someone has interfered with these Bee Hives by way of magic, attracting The Corruption in the process. ','','232dd939-f596-448d-9e95-3b6a3b97751c','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:01:00','2024-05-28 04:01:30'),('3d50f7f9-b287-45e7-94f3-6f30ce0c02b3','Beach Shack','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 10:59:23','A strange hut hidden away in an alcove on the beach. Something terrible seems to have happened inside.','','1d79d99b-619d-4a28-bfa6-99873927fb03','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 11:02:55','2024-05-27 11:02:55'),('3dbf133a-7dcb-41fe-8b16-e7d6cecdf504','Scourge','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 10:32:17','The Scourge are a horrific evil alien race brought into this land by The Sunder  a cataclysmic upheaval caused by the amoral lich king, Kygos, and his followers during the Dragon Wars. ','','','','','',NULL,NULL,'123','2024-05-27 10:34:22','2024-05-27 10:34:22'),('3fbc84b7-e7d5-48c1-8f81-808b53769245','Path To Hidden Grove','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 04:50:36','A not so subtly hidden path to the exiled druids cave.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 04:55:29','2024-05-27 04:55:29'),('42d8af55-d012-459e-8c87-04fb33eb3516','Test','cbf689b3-e858-4fe1-95a1-bcc4e36f4530','051a78e2-2f58-474f-b387-d87befe81005','Test','2024-05-20 20:32:02','Test','Test','051a78e2-2f58-474f-b387-d87befe81005','10286a55-d994-482b-bfaf-1e198f9d93e3',NULL,'Test',NULL,NULL,'123','2024-05-21 10:50:47','2024-05-21 10:50:47'),('4393a619-6669-4cf5-80ea-ad5f6dda8abd','Offshore Ship','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 11:04:21','A ship anchored far offshore, barely visible in the fog. ','','1d79d99b-619d-4a28-bfa6-99873927fb03','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 11:06:31','2024-05-27 11:06:31'),('4569c47c-05e0-4d06-b0da-89c2caedd581','The Collymore family.','64720eb0-51c2-4ed0-ab52-039414f1a362','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 04:44:38','The Collymore family is one of the more prominent mining families in Ethaevia. They are known for their expertise in mining and refining sulphur, a rare and valuable resource that can be used for various purposes, such as alchemy, magic, and weaponry. The family has a long and proud history of being loyal to the king and serving the realm with their skills and products.  The Collymore family consists of about 20 members, spanning three generations. The current head of the family is Reginald Collymore, a wise and respected elder who oversees the familys business and affairs. He is married to Eleanor Collymore, a graceful and elegant woman who is well-versed in etiquette and diplomacy. They have four children: Richard, Robert, Rosalind, and Rebecca. Richard is the eldest son and heir to the family title and fortune. He is a brave and skilled warrior who leads the familys security forces. Robert is the second son and a talented engineer who designs and builds the familys mining equipment and machinery. Rosalind is the eldest daughter and a gifted alchemist who creates and sells various potions and elixirs using sulphur as a main ingredient. Rebecca is the youngest daughter and a charming and adventurous explorer who travels around the realm to find new sources of sulphur and other rare minerals.  The Collymore family recently moved to a small town called Yellowbay, on a lake near a mountina range. They discovered a large and rich sulphur mine there, which they decided to exploit and develop. The family bought a large estate in the town, where they built their residence, workshop, laboratory, and warehouse. They also hired local workers to help them with their mining operations. The Collymore family hopes to make Yellowbay their new home base and expand their influence and reputation in Ethaevia.','','','','','',NULL,NULL,'123','2024-05-27 04:47:43','2024-05-27 04:47:43'),('47e26712-d8b9-41f6-a048-1440cdb5a64e','Yellowbay Beach','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 06:53:11','Yellowbay Beach is a large beach that can be both beautiful and deadly. On glorious summer days, it is the default refuge for people to relax and play. However, Yellowbay can be prone to severe storms, which when combined with some rocky outcrops and deceiving water flows, has led to a large number of shipwrecks over the years. ','','1d79d99b-619d-4a28-bfa6-99873927fb03','','c5cb4310-cc01-4509-863c-0b2f7d26ef09','',NULL,NULL,'123','2024-05-27 06:58:12','2024-05-27 06:58:12'),('4ead1926-8c03-42bb-8e76-52a54a1921ba','Dog','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 10:38:36','Whoa, you can talk!!! I used to hear other dogs far away at the farm, but now they are all quiet. Do you have any treats?','','','','','',NULL,NULL,'123','2024-05-27 10:40:15','2024-05-27 10:40:15'),('51e78828-6dc6-48a0-95b0-7cc184224db5','Dead Sea Gulls','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 07:17:07','Several recently deceased sea gulls are placed around the outside of the mysterious hut. They all seem to have suffered a violent death. ','','1d79d99b-619d-4a28-bfa6-99873927fb03','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 07:19:09','2024-05-27 07:19:09'),('54013b79-7395-4a09-bd2f-3f7946690fb7','Horsecut Farm/Cottage','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','9270deaf-7271-4cf6-852e-30d4a067d298','','2024-05-27 05:20:29','The small farmhouse of the Horsecut family, abandoned as The Corruption took hold in the area. The main building has now been overrun by vile growths.','','9270deaf-7271-4cf6-852e-30d4a067d298','526d9422-4fc4-4112-b3d9-3e227a980afa','6ae3d6dd-c907-4019-989a-f921cf94b4ed','',NULL,NULL,'123','2024-05-27 05:27:18','2024-05-27 05:27:18'),('5504855a-9783-4d36-a75e-f4fb03c7fb44','The hamlet of Appleway on Yellow Bay.','6ae3d6dd-c907-4019-989a-f921cf94b4ed','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','','2024-05-27 09:45:11','Welcome to the once-thriving hamlet of Appleway, now shrouded in an air of uncertainty and despair. Nestled on the edge of the vast grasslands, Appleway was once known for its abundant orchards and flourishing crops. However, a malevolent curse has cast a shadow over the land, causing the nearby crops to wither and fail, leaving the villagers in a state of distress.','','','','','',NULL,NULL,'123','2024-05-27 09:59:36','2024-05-27 09:59:36'),('550c61a5-6065-4c6b-aa74-6a5cd8e51dfa','Druid Grove Corruption','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 05:04:02','Large clusters of The Corruption have overtaken the druid grove, slowly draining magic that has long resided in the area, converting it into foul, tainted soil. This has attracted all kinds of unsavory creatures and will eventually lead to all of Yellow Bay being overrun by The Scourge.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 05:08:03','2024-05-27 05:08:03'),('56fdba29-2f89-4265-93b9-9379ad79427d','Statue With Crystal','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 03:58:41','A large, gold state holding a glowing crystal. The magic that remains within the crystal is weak, barely able to sustain itself. ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 04:04:58','2024-05-27 04:04:58'),('60eed3ec-f3ad-45a1-add2-aefd6349844c','Sacred Druid Grove','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 11:24:43','The Grove is also home to an enormous Dragon Skeleton. Dragons are rare, ancient guardians of nature. They can live for 1000s of years, are highly elemental and extremely dangerous. ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','','',NULL,NULL,'123','2024-05-27 11:28:22','2024-05-27 11:28:22'),('6586f01d-e5cd-45ea-b155-b507b6baec84','Bee Hives','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','232dd939-f596-448d-9e95-3b6a3b97751c','','2024-05-28 04:29:36','Bee Hives that have been tainted by The Corruption. ','','232dd939-f596-448d-9e95-3b6a3b97751c','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:31:55','2024-05-28 04:32:28'),('65977655-f685-478b-b414-e235756f1b5d','Hildas Inn','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','','2024-05-28 03:07:36','A small inn run by a Woman called Hilda.','','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 03:11:09','2024-05-28 03:12:13'),('66964190-930e-4a1c-8211-120a9ecff633','Druids','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 04:05:32','Druids are magicians of nature. They live in, tend to, protect and work with nature in all its forms and derive powerful magicks from the forces of nature. They are often confused for witches or wizards, who use Arcane Magic, but Druids use Natural Magic. ','','','','','',NULL,NULL,'123','2024-05-27 04:10:40','2024-05-27 04:10:40'),('66bc6ecc-0d2c-40bb-bbd4-62c4bdc7d0d3','Dragon Skeletons A','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 06:37:05','Many dragons died during the dragon war and for some reason several of them came to be laid to rest here. Regardless of why their bones are in this location, their presence has cause this place to be a centre of magical energy.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:39:44','2024-05-27 06:39:44'),('684029a5-432d-44f8-9449-70b73b697868','Yellowbay Graveyard','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 04:15:50','Having been founded a number of generations ago, Yellowbay has its own well-established graveyard for the many family members who have come and gone. Some of the more wealthy families were able to afford costly mausoleums and magically-enhanced statues. Rumour has it something lurks in the graveyard now and it is mostly avoided.  ','','','','','',NULL,NULL,'123','2024-05-27 04:18:49','2024-05-27 04:18:49'),('70110101-dd9a-4c12-8ed4-77c66489e41a','Green Earth Crystal','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 05:28:18','The focal point of the Sacred Druid Grove. A large, glowing green crystal that can be used to restore the ~natural balance~ of an area, along with a range of other power magics.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 05:31:11','2024-05-27 05:31:11'),('7116f64c-b11e-49e2-8f72-28caf0537bc7','Deer','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 11:59:01','Deer are harmless herbivores who will flee immediately upon being attacked. They are fast and have a high jump and will avoid combat at all costs. ','','','','','',NULL,NULL,'123','2024-05-27 12:00:33','2024-05-27 12:00:33'),('72007dff-7432-4675-b11a-88c0c57ac190','NEW','4d6edc8f-ad31-4264-b91a-d6412ce4d185','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','11','2024-05-27 10:18:31','fdfdfd','dddf','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','31c26934-30e1-46b4-9b95-53bee6b1d84b','27019f93-88fb-48f8-ae35-bf946f14ea72','Pune',NULL,NULL,'123','2024-05-27 10:24:52','2024-05-27 10:24:52'),('731a47e1-f868-4295-b996-b40fd07d3509','Cow','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 06:48:48','The grass tastes strange, I only eat what the Farmer gives me. Sometimes when it is dark I hear strange sounds.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:52:18','2024-05-27 06:52:18'),('759f2651-6e25-42af-abe3-748ca3060644','Mothers Empty Warehouse','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','','2024-05-28 03:41:54','Once filled with farm produce and trade goods, this warehouse now lies empty. In these troubled times there is no trade and little food and the warehouse remains unused.','','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 03:44:16','2024-05-28 03:44:16'),('797321f4-0360-4fa0-a6d2-de24af709be5','Corrupted Horsecut Farm','64720eb0-51c2-4ed0-ab52-039414f1a362','','','2024-05-27 10:48:59','The Horsecut family founded a crop farm here several generations ago. They successfully grew a variety of crops and made a solid trade. However, rumour has it that recently some evil force swept through the land, scattered the family and now the farm is abandoned and worthless.  ','','9270deaf-7271-4cf6-852e-30d4a067d298','','','',NULL,NULL,'123','2024-05-27 10:51:39','2024-05-27 10:51:39'),('79b93bbc-6e8c-4c4d-973e-e3e3025e9bf6','Suspicious Table with offerings','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-28 03:48:06','A small table covered in candles and questionable offerings to unknown gods. Underneath lines what may be the previous inhabitants of this hidden place.    Extended: Before the lone Druid took residence in this hidden cave and created the Purification Stone/Crystal, a small group of local magic users had been gathering here to conduct secret rituals with the aim of increasing their personal prosperity. This is the cause of the overly large apples, suspicious bee hives and what ultimately attracted The Corruption to the area.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 03:50:03','2024-05-28 03:50:03'),('7be1872f-7e50-4ca0-8d0f-2d015f2175d3','Path to the Farmhouse/Cottage','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-28 04:23:46','A small path of the side of the main road to the Horsecut Farm. It appears to have not been used in some time.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:26:13','2024-05-28 04:26:13'),('7d1297a0-d71b-4b5f-b474-1e27f5f6b672','Piles of Moss-Covered Bones','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 04:11:36','Large piles of ancient bones litter the Druid Grove. Some are creatures that can be easily identified (Cows, bears, deer), others seem to be of unknown origin. ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'string','2024-05-27 04:14:39','2024-05-27 04:14:39'),('7f9af515-43b7-46cb-b63c-e19ba07c7fc5','Offerings','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 08:02:45','Scattered around the base of the Statue are coins and lumps of strange glowing minerals. Thes offerings are occasionally to the Wizard in exchange for favors  or good fortune. There are also long dead bodies scattered around the hillside, their origin is unknown.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 08:06:52','2024-05-27 08:06:52'),('7fcd728c-b6a2-4fb0-b053-c45762c3af6a','White Crystal of Purification','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 10:28:23','A large, humming crystal that has been embused with the powers of purification in an attempt to fight back the spread of The Corruption in the area. Small shards have been chipped off to allow those without the gift of Magic to counteract small clusters of Corruption.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 10:31:30','2024-05-27 10:31:30'),('844eb293-d495-4268-99cf-9b114953050b','Golems are enormous solid humanoids created by magic-users.','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-28 04:35:43','Golems are enormous solid humanoids created by magic-users.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','31c26934-30e1-46b4-9b95-53bee6b1d84b','','',NULL,NULL,'123','2024-05-28 04:38:00','2024-05-28 04:38:00'),('8658dda7-6b7d-4604-8ea6-61d69b4e1bf9','Collection of Message Bottles','6ae3d6dd-c907-4019-989a-f921cf94b4ed','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 06:29:32','A collection of hundreds of bottles filled with handwritten messages litter the front of the Beach Hut. ','','1d79d99b-619d-4a28-bfa6-99873927fb03','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:32:00','2024-05-27 06:32:00'),('8b2aebc5-8193-4138-a606-5fb7ee87dc20','Dragon Wars','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 11:07:37','The Dragon Wars were so named due to the sudden appearance of dozens of dragons, shortly before The Sunder. The Dragons had been dormant for centuries, but from the sky, earth and sea, they ruthlessly razed all aspects of civilisation. The formidable sorcerer Lich King Kygos contacted the commanding wizards across all the nations to invoke a cease-fire. He hoped to combine all war Artefacts to open a rift to outer dimensions, summoning extraplanar creatures of extraordinary power to destroy the dragons. Whilst many of the Dragons were defeated, the Scourge were in their place, and life as people knew it in Ethaevia changed forever. Everyone fled the mainland to islands for decades, and only in the last year have people been returning to the savaged continent.  ','','f82f7be6-d348-46a8-8dcc-47513100d121','','','',NULL,NULL,'123','2024-05-27 11:10:52','2024-05-27 11:10:52'),('8b8062cc-69cb-4c32-8d69-84afbc504cd3','Path Through the Mountains','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 06:45:10','A roadway that has been cut through the rocky mountain side.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:47:34','2024-05-27 06:47:34'),('8c010ca0-d068-42d8-a7f9-2b8ba9610187','Giants Camp','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-28 04:46:41','A family of Giants have taken up residence along the road to the Mines. This combined with the spread of Corruption in the area has detoured most travelers from this area.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','526d9422-4fc4-4112-b3d9-3e227a980afa','string','',NULL,NULL,'123','2024-05-28 04:49:05','2024-05-28 04:49:05'),('8e704ab8-ccaa-4532-afc9-f028f63d844e','Standing Stones A','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 09:12:55','Interacting with these stones in a certain way may result in magical giftsor curses.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 09:14:53','2024-05-27 09:14:53'),('90599a7b-1859-48cc-8141-aecd84e77d51','Large Corruption Flowers','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','9270deaf-7271-4cf6-852e-30d4a067d298','','2024-05-27 10:13:22','Large, brightly coloured Flowers that bloom when The Corruption is at its strongest. These large plants emit a corrosive liquid that is both incredibly painful to the touch but can also contaminate all that it comes in contact with. This is particularly hazardous around water supplies and food crops.  Once fully opened, the Flower releases a cloud containing spores that will contaminate the surrounding area.  ','','9270deaf-7271-4cf6-852e-30d4a067d298','526d9422-4fc4-4112-b3d9-3e227a980afa','6ae3d6dd-c907-4019-989a-f921cf94b4ed','',NULL,NULL,'123','2024-05-27 10:16:18','2024-05-27 10:16:18'),('914adb6c-6dbc-4312-9cde-2067d01ec1c4','Shore Front','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 11:54:34','A small shore front that somehow always seems to perpetually be surrounded by storms, most likely of magical origin. This has led to the somewhat frequent occurrence of shipwreck survivors washing up along the shoreline. ','','1d79d99b-619d-4a28-bfa6-99873927fb03','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 11:58:18','2024-05-27 11:58:18'),('91ec1923-be72-4d89-a4db-d492c8c2b17f','Scattered Scrolls','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 06:32:53','Hundreds of scrolls containing handwritten messages from those whove lost loved ones to the sea. ','','1d79d99b-619d-4a28-bfa6-99873927fb03','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:36:07','2024-05-27 06:36:07'),('9257f489-5a8d-434d-9aff-3d796810c5b4','Sacred Druid Grove','6ae3d6dd-c907-4019-989a-f921cf94b4ed','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 11:32:59','Druids have been creating Sacred Groves for millennia. They act as meeting places, calendars, ritual centres, burial grounds and holy sanctums. With a focus on life and goodness, those so disposed will find they might gain a benefit from staying in the Grove, while those who are less so inclined will feel ill at ease and unwelcome. ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','','',NULL,NULL,'123','2024-05-27 11:35:25','2024-05-27 11:35:25'),('92cd7369-c51c-47d4-b9fc-b68bb6898799','Abandoned Camp','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 05:36:44','A small tent containing a pair of long dead adventurers. The residents of Yellow Bay have chosen to leave them in their resting place as a sign of respect to the dead, as well as a welcome/warning to those recently washed up ashore. ','','1d79d99b-619d-4a28-bfa6-99873927fb03','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 05:40:47','2024-05-27 05:40:47'),('95324bd6-c0cb-4938-8a83-a97b72f66e07','Makeshift Bridge','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','9270deaf-7271-4cf6-852e-30d4a067d298','','2024-05-27 05:32:28','A makeshift bridge, quickly constructed to replace the one destroyed centuries ago during the Dragon War.  ','','9270deaf-7271-4cf6-852e-30d4a067d298','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 05:35:29','2024-05-27 05:35:29'),('970dccf6-42ed-48cc-8225-aa5e8dfdaa55','Travelers Outpost','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-28 04:13:24','This is an outpost that once provided shelter for people travelling to and from the Silver Mine, abandoned since the troubles began and the mine was shut down.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:18:11','2024-05-28 04:18:11'),('9a2eb18a-2c70-4e2a-8a96-cd9f2b53798d','Little Totems','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 06:08:16','Scattered throughout Yellow Bay are small, carved stones. These are vaguely humanoid in appearance and always appear in clusters. Their origins are unknown, but it is considered bad luck to interfere with them. ','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:10:56','2024-05-27 06:10:56'),('9d89fe95-7d11-4ed1-a82b-98fcfa728bed','Golems','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 08:10:52','Golems have incredible strength and durability. They are mostly used to mine, carry heavy loads and in combat. It is said that the creation and upkeep of these golems places enormous strain on the environment.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','','',NULL,NULL,'123','2024-05-27 08:13:38','2024-05-27 08:13:38'),('9f130767-0b30-4007-86af-9d7899b7485d','Bear','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 05:41:50','Bears can be very territorial. If they are at a distance, they will ignore you, but once close, they are likely to close distance and attack with their significant claws and bite. Bears can often be hard to see in foliage due to their colouration.  ','','f82f7be6-d348-46a8-8dcc-47513100d121','','','',NULL,NULL,'123','2024-05-27 05:45:13','2024-05-27 05:45:13'),('a6084176-94b1-445b-97dc-9e50f0e1d081','Witches','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-28 04:52:36','Witches live alone in natural locations (often forests but can be elsewhere) and derive their powers from magical pacts with powerful other-worldly entities. Whilst often evil and self-serving, witches can be a source of information, resources and quests. One must be careful when dealing with witches as they are often very adept at deceit. Witches are often happy to trade. ','','','','','',NULL,NULL,'123','2024-05-28 04:54:21','2024-05-28 04:54:21'),('a78354f3-87a4-4547-998a-657532cd4968','The Dragon War','69ba5515-58f6-42ac-b815-b019f255cfb0','1e5a79d2-cc24-49f6-b50b-b24b6de702f7',NULL,'2024-05-29 14:00:00','The dragon war, was a terrible time',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Tell me about the skeleton, Tell me about reptiles, What can cause corruption?, How did things go wrong?','2024-05-29 22:07:57','2024-05-29 22:07:57'),('a9c814e2-b5c3-4fd7-854a-274fef53c922','Hilda','64720eb0-51c2-4ed0-ab52-039414f1a362','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','','2024-05-27 11:12:02','Hilda is the matriarch of the Horsecut Family, and is the main point of contact for them. She is often found out and about, and politely asking or sternly ordering people to assist in keeping her family and homestead alive and thriving.  ','','','','e085acd6-bfbe-49e3-a871-cbad7ccdf71d','',NULL,NULL,'123','2024-05-27 11:15:45','2024-05-27 11:15:45'),('ab454ab4-bf52-4cf1-b1c8-770574efe36f','Apple Trees','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','232dd939-f596-448d-9e95-3b6a3b97751c','','2024-05-28 04:27:02','Seemingly normal apple trees, all bearing an alarming quantity of fruit ','','232dd939-f596-448d-9e95-3b6a3b97751c','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:28:46','2024-05-28 04:28:46'),('acb5c7f6-8bbe-469d-8b1d-d7b88dc109ae','Arcane Magic','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-28 04:38:22','Most people believe that the increased use of Arcane Magic has been the cause of the deterioration of the natural environment ','','','','','',NULL,NULL,'123','2024-05-28 04:40:08','2024-05-28 04:40:08'),('b13e37b1-ef26-4f77-ad0e-f0c93b40285b','Nature Lore, the understanding of the natural world.','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 11:17:49','Nature Lore, the understanding of the natural world. The world is a wonderous place, with giants, goblins, wolves, bears and many animals. Nature lore also teaches about the unusual aspects of nature which may be magical. ','','','','','',NULL,NULL,'123','2024-05-27 11:19:58','2024-05-27 11:19:58'),('b3806c58-ef3e-46f0-9974-d2ac933c419c','Corrupted Horsecut Farm','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-28 04:10:08','The Horsecut Farm has been consumed by Corruption  a Life-draining, evil force spread by the hideous Outsiders, the Scourge. Avoid touching Corruption and if possible, destroy anything that spreads Corruption.  ','','','','','',NULL,NULL,'123','2024-05-28 04:12:15','2024-05-28 04:12:15'),('b591350f-3f2c-4581-b855-2dce96e69ab1','The Mines. ','6ae3d6dd-c907-4019-989a-f921cf94b4ed','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-28 03:20:46','The mines began as a silver mine, which essentially played out however sulphur was discovered and used for magical weapons in the wars. ','','','','4569c47c-05e0-4d06-b0da-89c2caedd581','',NULL,NULL,'123','2024-05-28 03:25:29','2024-05-28 03:25:29'),('b74928ea-0694-4f22-ae2b-f4a1720f1df4','Endless Plains','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 08:18:23','Deep within Yellowbay, a section of plains stretches off into the middle of Ethaevia, with hills as far as the eye can see. These were named the Endless Plains and people are warned not to travel unless they are highly experienced. This is not only due to risk of getting lost, thirst or starvation, but they are home to many critters and occasionally an enormous Giant.  ','','f82f7be6-d348-46a8-8dcc-47513100d121','','','',NULL,NULL,'123','2024-05-27 08:20:41','2024-05-27 08:20:41'),('c4c1ff73-1902-4e44-85c4-4956e7ec5fba','Strange Sample','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 09:05:05','Deep in the mine is a green pool, with strange fungi growing out of it. The strange fungus needs a sample taken, its deep within the silver mine past the strange hexagonal columns down a deep cave. ','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','31c26934-30e1-46b4-9b95-53bee6b1d84b','','15040.0,-8590.0,-1190.0',NULL,NULL,'123','2024-05-27 09:08:12','2024-05-27 09:08:12'),('c5cb4310-cc01-4509-863c-0b2f7d26ef09','Yellowbay basic lore','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 06:11:57','You are in the small town of Yellowbay, which is mostly occupied by humans. ','','f82f7be6-d348-46a8-8dcc-47513100d121','','','',NULL,NULL,'123','2024-05-27 06:14:49','2024-05-27 06:14:49'),('c720d5a6-4d73-4ec6-8482-184182a935cd','Blood key','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-28 03:16:57','Blood keys are an invention born out of the use of Necromancy. It was discovered that items could be linked to the blood of an individual and then only direct members of their bloodline could operate that item. One of the most common uses was with keys, ensuring that important locks could only be opened with special keys held be family members. Blood keys can be constructed with a number of magical components and a few drops of blood from the relevant family member, either from a live person or if the blood has been preserved.  ','','','','','',NULL,NULL,'123','2024-05-28 03:19:57','2024-05-28 03:19:57'),('c7ecf223-d2eb-41cf-a4c9-3dd4edc7bc44','Statue','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-28 03:12:42','A larger-than-life statue of an unknown Wizard, holding a lantern containing a unique version of the Illuminating Liquid used throughout Yellow Bay. Perhaps this is the inventor of this substance? Or some other important magical figure?','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 03:15:48','2024-05-28 03:15:48'),('c9f31ac1-4a48-42f2-b7aa-eb6a4cc7a36f','Goat','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 11:42:28','What? Are you talking to me? Fancy that! ','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','db42b01b-8475-4919-ab00-dc6163c1b92c','',NULL,NULL,'123','2024-05-27 11:47:50','2024-05-27 11:47:50'),('ca5229f7-fa56-45f2-8781-21a658d1c1cd','Magic Lantern ','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 08:45:45','Luminescent substance found in Lanterns throughout Yellow Bay is made from a crystal that is extracted from the mines in Yellow Bay. They date back to before the Dragon War and the ban on Magics in the area. The Current inhabitants of Yellow Bay have lost the art of making this substance and have begun exploring the abandoned mines to find more to repair/replenish this resource.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 08:47:44','2024-05-27 08:47:44'),('cb6a6846-8d0c-4b47-bb96-e81fd0275644','Corruption Magic','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 08:41:00','Corruption is a growing, evil mutation of the land, spread by the insidious alien race, The Scourge. Corruption spreads and infects everything it touches, draining life from plants and animals and consuming living essence of other things to create new aberrations. Corruption can be Purified by Druids or with purification shards or potions. Smashing Corruption Eggs with magical weapons and killing or purifying corrupted creatures also decreases the level of Corruption in an area.  ','','','','','',NULL,NULL,'123','2024-05-27 08:43:47','2024-05-27 08:43:47'),('ce61c81f-b03e-4238-b9e2-66e7dc993ab2','Ruins of an ancient temple','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 10:35:16','At the entry of the Druid Grove lie the barely visible ruins of some ancient stone structure. This has all but been reclaimed by earth.','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 10:37:53','2024-05-27 10:37:53'),('cefe5f94-7e40-464e-b6e5-99cde7372d83','Mine Entry','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 04:24:37','The long-abandoned mine entry. Residents of Yellow Bay have recently begun efforts to restart mining operations.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 04:30:00','2024-05-27 04:30:00'),('d18d5839-548d-4349-b7da-baf6fdff9605','Garanaxus - Fire Dragon','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 11:51:22','Garanaxus - Fire Dragon. A massive fire-breathing dragon controlling a large area. A Fire Dragon, Garanaxus, resides in the largest active volcano in the region, guarding an Artefact (the Orb of Elements) and a huge amount of magic items to prevent humanoids from using them it its bid to protect the environment. It regularly makes sweeps of its area to ensure no civilisation is occurring. However, despite the Dragon not using it, the Artefact is continuing to drain the environment, causing the volcano to constantly spew lava and ash, which the dragon loves as it is immune.  The active volcano is spewing ash and sulphur into the air, causing acid rain, which in turn affects crops for hundreds of miles, having a huge impact on the wide area. The local area is obsidian from a huge lava flow, the air is poisonous, and the dragon feels everywhere it can see is its domain.  There are multiple ways to get to the Dragon Lair, including underground Lava Flows. These can be found from underground friends (dwarves, goblins, trolls, giants, cyclops) or through spells (EQI  Where is an entrance to the volcano?)  The dragon uses fire, acute senses, enormous damage and the environment to its advantage in battle.','','','','','',NULL,NULL,'Dragon, Garanaxus, Terrible Reptile, Wars, I want to know where the corruption came from','2024-05-27 11:53:38','2024-05-29 22:04:58'),('d4b3e27e-35d8-422b-85ee-d95745b9ae44','Cave Behind Statue','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 06:41:32','Behind the Wizard Statue is a partially collapsed cave, bared by seemingly impenetrable metal gates. What where the past residents of Yellow Bay trying to keep out? Or in?','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 06:44:03','2024-05-27 06:44:03'),('d5512004-1a53-40a8-b502-2968e951fc66','Supplies','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 11:21:21','Supplies left abandoned when the previous operators of the mines hastily left the area.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 11:23:49','2024-05-27 11:23:49'),('d7a4244d-b358-44a3-898f-e7f36efb7e19','Path Inland','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 09:16:02','A rough path that leads inland, lit by magical lanterns.','','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 09:18:22','2024-05-27 09:18:22'),('d81ab800-bfe8-4ce1-a249-546820463435','Magic Items','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 08:15:05','The Mages of Ethaevia mastered the art of embedding magic permanently into carefully crafted items. These items required precious metals and gems to harness the magic. As such, mining precious items from the earth became a priority for all nations. Magic item creation became more common, not only with royalty and aristocracy, but with the middle class, who could now afford magical trinkets for the family. This universal bedazzlement and thirst for luxuries gave leaders the perfect avenue to stay in power. ','','','','','',NULL,NULL,'123','2024-05-27 08:17:20','2024-05-27 08:17:20'),('d8d9aad6-f22b-493f-a046-10553dc0b82d','Strange machine','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','4a2d7966-4b28-44c1-8375-6f25c2d17abf','','2024-05-27 05:46:15','An elaborate machine built by some ancient civilization. It appears to utilize both the Green and Blue minerals found within the mines. What it does, if anything, is a mystery.','','4a2d7966-4b28-44c1-8375-6f25c2d17abf','31c26934-30e1-46b4-9b95-53bee6b1d84b','','',NULL,NULL,'123','2024-05-27 05:51:07','2024-05-27 05:51:07'),('db42b01b-8475-4919-ab00-dc6163c1b92c','Orchard ','6ae3d6dd-c907-4019-989a-f921cf94b4ed','232dd939-f596-448d-9e95-3b6a3b97751c','','2024-05-27 05:13:28','A delightful orchard with delicious apple trees and bountiful beehives is here. The Horsecut family sold both the apples and honey for food, medical and magical benefits. ','','232dd939-f596-448d-9e95-3b6a3b97751c','','','',NULL,NULL,'123','2024-05-27 05:19:17','2024-05-27 05:19:17'),('dde9439a-c299-4a75-bac3-5de1b82259fd','Invasive Red Flowers','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-28 04:19:13','Strange red flowers that seem to be over taking Yellow Bay in recent years.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:22:47','2024-05-28 04:22:47'),('df329d4b-d1c7-4ad5-8f1c-c8671e7812ed','Suspiciously Large Apples','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','232dd939-f596-448d-9e95-3b6a3b97751c','','2024-05-27 08:49:41','A number of uncommonly large apples can be found in the Yellow Bay Orchard.  Whether or not these are of natural or supernatural origin is up for debate. ','','232dd939-f596-448d-9e95-3b6a3b97751c','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 08:52:14','2024-05-27 08:52:14'),('df38bec5-fb50-498c-8b6d-2527e099d8d5','Sacred Druid Grove','6ae3d6dd-c907-4019-989a-f921cf94b4ed','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 05:56:54','In a bid of heal the land of the foul Corruption that had scoured it, the local Druid, Armanias, managed to collect a large amount of Corruption in a sacred crystal, and cast a cleansing ritual to create a bunch of crystal shards that aid in purifying the land of the evil.  ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','','',NULL,NULL,'123','2024-05-27 06:03:16','2024-05-27 06:03:16'),('e085acd6-bfbe-49e3-a871-cbad7ccdf71d','The Horsecut family of Yellow Bay.','64720eb0-51c2-4ed0-ab52-039414f1a362','','','2024-05-27 03:37:48','The Horsecut family had been farming the land of Yellowbay for generations. They were known for their hard work, honesty, and loyalty to the king. They had a large herd of horses, which they bred and trained for various purposes. Some of their horses were sold to the royal army, some to the merchants and travelers, and some to the local villagers. The Horsecut family also grew crops and raised livestock, which they traded with their neighbors or sold at the market.  The Horsecut family consisted of six members: the father, John; the mother, Mary; the eldest son, James; the eldest daughter, Jane; the youngest son, Jack; and the youngest daughter, Jill. They lived in a cozy farmhouse near the river, surrounded by fields and pastures. They were a happy and contented family, always helping each other and enjoying their simple life.  One day, however, their peaceful life was shattered by a terrible news. The king had declared war on a neighboring kingdom, and he had ordered all able-bodied men to join his army. James, who was 18 years old, had to leave his family and go to war. He was brave and loyal, but he was also scared and sad. He hugged his parents and siblings goodbye, mounted his horse, and rode away with tears in his eyes.  The Horsecut family was devastated by James departure. They prayed for his safety and hoped for his return. They also had to work harder to maintain their farm without him. John took care of the horses and the crops, Mary took care of the livestock and the household chores, Jane took care of the market and the trading, Jack took care of the river and the fishing, and Jill took care of the garden and the herbs.  The war lasted for two years, and it was a bloody and brutal one. Many lives were lost on both sides, and many villages were burned and plundered. The Horsecut family heard nothing from James during that time. They feared the worst, but they never gave up hope.  One day, when they were having dinner at their farmhouse, they heard a knock on the door. John opened it, and he couldnt believe his eyes. It was James! He was alive! He was wounded and weary, but he was alive! He had survived the war, and he had come back home!  The Horsecut family was overjoyed by James return. They hugged him and kissed him and welcomed him back. They asked him about his experiences in the war, and he told them about his battles, his comrades, his enemies, his victories, and his losses. He also told them that he had been awarded a medal of honor by the king for his bravery and loyalty.  The Horsecut family celebrated James return with a feast. They invited their neighbors and friends to join them. They ate and drank and sang and danced until dawn. They thanked the gods for their blessings and their miracles.  The Horsecut family resumed their normal life after James return. They continued to farm the land of Yellowbay with love and care. They were happy and contented again, always helping each other and enjoying their simple life.  They never forgot the war or its horrors, but they also never lost their hope or their joy.  They were the Horsecut family, a family of farmers in Yellowbay.','','9270deaf-7271-4cf6-852e-30d4a067d298','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 03:49:42','2024-05-27 03:49:42'),('e08bfb8e-b66e-4787-8323-1bc586ffb9a0','Druid Grove','6ae3d6dd-c907-4019-989a-f921cf94b4ed','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 08:21:28','Druids themselves get great benefit from being in a Grove and can often commune with nature better and have enhanced healing magic.  ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','','',NULL,NULL,'123','2024-05-27 08:24:11','2024-05-27 08:24:11'),('e11d2a0b-1076-4a0d-a5b8-c02b1ffc8c0d','The Sunder','fa2f3213-1a42-40b4-9a10-4285c306c200','','','2024-05-27 07:30:02','Kygos convinves other mages to use multiple Artefacts to open a Rift to defeat the Dragons. The Scourge appear.','','','','','',NULL,NULL,'123','2024-05-27 07:32:41','2024-05-27 07:32:41'),('e1d141df-f137-41f5-baac-e5a468e0d167','Horsecut Junction','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','9270deaf-7271-4cf6-852e-30d4a067d298','','2024-05-28 03:51:10','An intersection that technically leads in 4 directions  to the Wizard shrine and whatever lines hidden in the cave beyond, to the not-so-abandoned mine, to the recently-abandoned Druid Grove and to the Horsecut family cottage and back to the beach.','','9270deaf-7271-4cf6-852e-30d4a067d298','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 03:56:45','2024-05-28 03:56:45'),('e5ccf96f-fe2b-4fee-bbc0-4e683af58a91','Sacred Druid Grove','6ae3d6dd-c907-4019-989a-f921cf94b4ed','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 10:45:00','There is a very old Druidic Grove here. Druids have come here for millenia to meet and practice their arts. Is it supposedly a holy place of sorts for those for respect nature.  There may be a druid caretaker in the area.','','','','','',NULL,NULL,'123','2024-05-27 10:47:26','2024-05-27 10:47:26'),('e718b3e4-cb70-464b-b544-6ba4b3586cb6','Garius','6ae3d6dd-c907-4019-989a-f921cf94b4ed','','','2024-05-27 07:05:10','Garius, often simply called The Beachcomber, the Beachcomber has a shack and sometimes has potions which he makes and other curios which he finds. ','','1d79d99b-619d-4a28-bfa6-99873927fb03','','47e26712-d8b9-41f6-a048-1440cdb5a64e','',NULL,NULL,'123','2024-05-27 07:09:39','2024-05-27 07:09:39'),('e764558a-79fd-4a70-ace8-7aa40ff12a95','Entry to Beach Shack','6ae3d6dd-c907-4019-989a-f921cf94b4ed','1d79d99b-619d-4a28-bfa6-99873927fb03','','2024-05-27 08:56:52','The skull of some large, long dead sea beast decorates the entry.','','1d79d99b-619d-4a28-bfa6-99873927fb03','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 08:58:46','2024-05-27 08:58:46'),('e98ff13e-b807-4e74-ab83-9d8b2f9de180','Blood Magic','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','','','2024-05-27 10:53:05','The rich merchant kings and sorceress queens took advantage of the growing trend of blood magic. Enhanced blood could be re-injected into their organs to enhance beauty and function. Magic creatures body parts were harvested for supernatural enhancements. These augmentations led to deep insights of the aging process, allowing the wealthy and powerful to prolong life and delay death. Soul retrieval by royal clerics animated corpses that created a tireless slave labour force of skeletons and zombies. Through other powerful rituals, leaders could live forever as formidable mummies, liches or vampires. Soul capture became a powerful tool for every nation. Even golems were gifted with the sophisticated intelligence of embedded souls for their decision-making. Unnoticed, these golems souls all started quietly talking to each other. ','','','','','',NULL,NULL,'123','2024-05-27 10:54:43','2024-05-27 10:54:43'),('ea75a8c4-4363-4e5b-8c48-dac4007e9775','Magical Lanterns','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 08:33:01','Eerie glowing lanterns that can be found throughout Yellow Bay. The seem to be powered by a substance of magical origin.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 08:35:26','2024-05-27 08:35:26'),('ee1e61c2-8f5e-4a77-8ce6-382b7d03a39e','Makeshift Graveyard','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','','2024-05-28 04:43:51','A small impromptu burial ground along the road between the beach front and hamlet. The unnamed deceased that often wash up on the shores of Yellowbay are buried here.  It also seems to have attracted a group of the less restful dead.','','1e5a79d2-cc24-49f6-b50b-b24b6de702f7','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-28 04:46:20','2024-05-28 04:46:20'),('ee404469-f71d-4da5-9bcf-621651b9b4b2','The Corruption','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 08:53:10','These foreign growths have recently spread throughout the region of Yellow Bay, engulfing the Orchard and Horsecut Farm. They emit an eerie glow that is accompanied by an otherworldy sound that defies description. The presence of these malign growths causes the area around them to be deadly to all creatures.','','','','','',NULL,NULL,'123','2024-05-27 08:55:36','2024-05-27 08:55:36'),('ef5204b2-9ef5-4d26-b810-11b25470ee54','Hunters Camp A','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-27 04:34:38','It appears that the corruption has infected the hunters that made their camp here and turned them into blight creatures. The strange rabbit in the cage also appears to carry the taint of corruption.','','f82f7be6-d348-46a8-8dcc-47513100d121','526d9422-4fc4-4112-b3d9-3e227a980afa','','',NULL,NULL,'123','2024-05-27 04:41:24','2024-05-27 04:41:24'),('f01f8856-7e26-4b82-9fdd-f4b6de1c5754','Pig','a482e644-e06d-4027-b1e7-1d29b5cbe6a9','f82f7be6-d348-46a8-8dcc-47513100d121','','2024-05-28 04:40:30','There really is something foul on the air, can\'t you smell it? The humans are frightened, I can smell that too.','','','','','',NULL,NULL,'123','2024-05-28 04:42:30','2024-05-28 04:42:30'),('f7a2d7a9-5902-4d2f-807b-c204b75323ee','Dragon Bones','dae93ddb-a322-48b1-9976-ab9334b35444','2141e10a-3f68-402f-9d3c-087ca38ed7f2','','2024-05-27 09:19:50','Dragon bones can be used for crafting Anti-Corruption Potions, weapons and items that impress people. One needs sufficient Wizard or Druid skills to use them effectively.  ','','2141e10a-3f68-402f-9d3c-087ca38ed7f2','526d9422-4fc4-4112-b3d9-3e227a980afa','df38bec5-fb50-498c-8b6d-2527e099d8d5','',NULL,NULL,'123','2024-05-27 09:24:55','2024-05-27 09:24:55');
